// src/pages/LandingPage.js
import React from 'react';
import { Link } from 'react-router-dom';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import Header from './components/Header/Header';
import Hero from './components/Hero/Hero';
import Features from './components/Features/Features';
import Testimonials from './components/Testimonials/Testimonials';
import About from './components/About/About';
import CTA from '../components/CTA/CTA';
import Footer from '../components/Footer/Footer';
import Login from '../pages/LoginPage';
import Register from '../pages/RegisterPage';
import ResidentDashboard from '../pages/dashboards/ResidentDashboard';
import SecretaryDashboard from '../pages/dashboards/SecretaryDashboard';
import TreasurerDashboard from '../pages/dashboards/TreasurerDashboard';
import MaintenanceDashboard from '../pages/dashboards/MaintenanceDashboard';
import SecurityDashboard from '../pages/dashboards/SecurityDashboard';

// Layout component for pages with header and footer
const PageLayout = ({ children }) => {
  return (
    <>
      <Header />
      <main>
        {children}
      </main>
      <Footer />
    </>
  );
};

// Layout for dashboard pages (no header/footer)
const DashboardLayout = ({ children }) => {
  return children;
};

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          {/* Public routes with header and footer */}
          <Route path="/login" element={
            <PageLayout>
              <Login />
            </PageLayout>
          } />
          <Route path="/register" element={
            <PageLayout>
              <Register />
            </PageLayout>
          } />
          <Route path="/" element={
            <PageLayout>
              <Hero />
              <Features />
              <Testimonials />
              <About />
              <CTA />
            </PageLayout>
          } />

          {/* Dashboard routes without header/footer */}
          <Route path="/resident-dashboard" element={
            <DashboardLayout>
              <ResidentDashboard />
            </DashboardLayout>
          } />
          <Route path="/secretary-dashboard" element={
            <DashboardLayout>
              <SecretaryDashboard />
            </DashboardLayout>
          } />
          <Route path="/treasurer-dashboard" element={
            <DashboardLayout>
              <TreasurerDashboard />
            </DashboardLayout>
          } />
          <Route path="/maintenance-dashboard" element={
            <DashboardLayout>
              <MaintenanceDashboard />
            </DashboardLayout>
          } />
          <Route path="/security-dashboard" element={
            <DashboardLayout>
              <SecurityDashboard />
            </DashboardLayout>
          } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
